import React from 'react';
import './Login.css'


export default function Login(){

    return(
        <div className="login-page">
            <div className="page-heading header-text">
                <div className="container">
                    <div className="row">
                        <div className="col-md-12">
                            <h1 >Login</h1>
                        </div>
                    </div>

                </div>
            </div>
        </div>

    );

}
